import React, { useState, useEffect } from "react";
import Typed from "react-typed";
import "./Home.css";

const Home = () => {
  return (
    <div id="home">
        <Typed
            strings={["Hello, I am Zakaria Dani", "Hello, I am a Software Engineer"]}
            typeSpeed={40}
            backSpeed={50}
            loop
          />
    </div>
  );
};

export default Home;
